import React, { Component } from 'react';
import {Link} from 'react-router-dom'
class Recommend extends Component {
    state = {
        post:[
            {
                postId:1,
                txt:'程序猿生存指南-32 实习招聘（下）'
            },
            {
                postId:2,
                txt:'盘点 CSS Selectors Level 4 中新增的选择器'
            },
            {
                postId:3,
                txt:'如何正确的提出一个 Issue ？'
            }
        ]
    }
    render() {
        return (
            <div>
               <ul>
                   <li>
                       <Link to="/post/1"></Link>
                   </li>
                   <li>
                       <Link to="/post/2"></Link>
                   </li>
                   <li>
                       <Link to="/post/3"></Link>
                   </li>
               </ul>
            </div>
        );
    }
}

export default Recommend;
